function p_expr_param_op_value(param, op, value){
  var flag = new Boolean(false);
  switch(op) {
  case "EQ":
    flag = param == value;
    break;
  case "NOTEQ":
    flag = param != value;
    break;
  case "GT":
    flag = param > value;
    break;
  case "LT":
    flag = param < value;
    break;
  case "GTEQ":
    flag = param >= value;
    break;
  case "LTEQ":
    flag = param <= value;
    break;
  default:
    text = "I have never heard of that switch...";
  }
  return flag.toString();
}

function p_expr_param_is_connected(param, kw_connected){
  var flag = new Boolean(false);
  flag = param === kw_connected;
  return flag.toString();
}

function p_expr_param_isnot_connected(param, kw_connected){
  var flag = new Boolean(false);
  flag = param !== kw_connected;
  return flag.toString();
}

function p_expr_expr_and_expr(left, right){
  var l,r = 0
  var flag = new Boolean(false);
  if (left == "true"){
    l = 1
  }
  if (right == "true"){
    r = 1
  }
  l = Boolean(l)
  r = Boolean(r)
  flag = l && r;
  return flag.toString();
}

function p_expr_expr_or_expr(left, right){
  var l,r = 0
  var flag = new Boolean(false);
  if (left == "true"){
    l = 1
  }
  if (right == "true"){
    r = 1
  }
  l = Boolean(l)
  r = Boolean(r)
  flag = l || r;
  return flag.toString();
}

